import React from "react";
import "./contact.css"
import swt from './swt.jpg';

const Contact =() =>{
    return (
        <>
         <div className="container">
             <h1>Contact With Us</h1>
             <p>We would love to respond to your queries and help you to succeed.Feel free to get in touch with us.</p>
             <div className="contact-left">
                 <h3>Sent yor request</h3>
             </div>
             <div className="contact-right">
                 <h3>Reach Us</h3>
             </div>
         </div>
        </>
    )
}
export default Contact;
